import random

# 設定分數級距字典 (0.0, 0.1, ..., 1.0)
score_intervals = {round(i * 0.1, 1): 0 for i in range(11)}
total_score = 0  # 用於計算平均分數
max_score = float('-inf')  # 初始為負無限大，表示最大分數
max_score_id = None  # 記錄最大分數對應的 ID

from tqdm import tqdm
import sys

datasetType = sys.argv[1]
if datasetType == "test":
    eval_data = test_data
elif datasetType == "train":
    eval_data = train_data


for i in tqdm(range(0, len(eval_data))):
    data = eval_data[i]
    prompt = data['article']
    res = getFinetunedResponse(prompt, max_new_tokens=250)

    eval = evaluate_response(res, 
                             data['article'],
                             data['answer'],
                             data['mistake'],
                             data['hint'])

    printText = f"[ {data['id']} ]: {data['topic']}\n"

    edit_distance = 0
    anslength = eval['add_content'][1]

    for k, val in eval.items():
        edit_distance += val[0]
        if k == "retain_mishint":
            printText += f"{k}:\t[{val[0]}, {anslength}], {round(val[0] / anslength, 3):<5} {val}, {round(val[0] / val[1], 3)}\n"
            continue
        printText += f"{k}:\t{val}, {round(val[0] / val[1], 3)}\n"

    score = edit_distance / anslength
    printText += f"=> Edit score:\t[{edit_distance}, {anslength}], {round(edit_distance / val[1], 3)}\n\n"
    
    # print(printText)
    
    # 將 score 歸入相應的級距
    score_bin = round(score, 1)
    if score_bin in score_intervals:
        score_intervals[score_bin] += 1

    total_score += score
    
    # 更新最大分數及其對應的 ID
    if score > max_score:
        max_score = score
        max_score_id = data['id']
    
    with open(f"./eval_{datasetType}", mode="a", encoding="utf-8") as f:
        f.writelines(printText)
    
    with open(f"./res_{datasetType}", mode="a", encoding="utf-8") as f:
        f.writelines(f"[ {data['id']} ]: {data['topic']}\n" + res + "\n\n")
    

# 計算平均分數
average_score = total_score / len(eval_data)

# 印出級距分布
printText = ("Score Intervals Distribution:") + "\n"
for interval, count in score_intervals.items():
    printText += (f"Score range {interval}: {count} occurrences") + "\n"


printText += (f"\nAverage Score: {average_score}") + "\n"
printText += (f"Max Score: {max_score} (ID: {max_score_id})") + "\n"

print(printText)
with open(f"./eval_{datasetType}", mode="a", encoding="utf-8") as f:
    f.writelines(printText)
